(2, 'bbbbb', 'bbbbb', 'kiki', 'kiki', '2000-11-28', 'kiki@gmail.com', 'Безусловно, новая модель организационной деятельности однозначно фиксирует необходимость прогресса профессионального сообщества. А также независимые государства и по сей день остаются уделом либералов, которые жаждут быть объявлены нарушающими общечеловеческие нормы этики и морали.', , '2024-11-13 00:00:00');

